import React from "react";
import * as S from './styles'

import logo from '../../assets/logo.png'

function Header() {
    return (
        <S.Container>
            <S.leftSide>
                <img src={logo} alt="Logo"></img>
            </S.leftSide>
            <S.rightSide>

            </S.rightSide>
        </S.Container>
    )
}

export default Header;
